    <div className="results-page">
      <h2>Resultados del Quiz</h2>
      <p>Tu puntuaci√≥n: {score} de 10</p>
      <Link to="/" className="home-button">Volver al Inicio</Link>
    </div>
  );
};

export default ResultsPage;
